<script type="text/javascript">
	for (var i = document.images.length - 1; i >= 0; i--) {
		var img = document.images[i];
		img.title = img.src.match(/\w*.png$/);
	}
	function filter(q) {
		for (var i = document.images.length - 1; i >= 0;  i--) {
			var img = document.images[i];
			if (!q || img.title.indexOf(q) >=0)
				img.style.visibility = "visible";
			else
				img.style.visibility = "hidden";
		}
		return false;
	};
</script>
<hr />
<input onkeyup="filter(this.value);" /><input type="button" value="ok" />
